dldaaxkd/','链家房友','使用链家73天',100,'2017-02-09 12:38:20','高大上，默默关注一下','b514bec82a3a100ca328cfda8aa9d8f2'),(674,'http://cd.fang.lianjia.com//loupan/p_kdldaaxkd/','链家房友','使用链家143天',80,'2017-01-18 16:12:12','投资型公寓。均价25000元/平，还是产权只有40年，物业费16元的商住公寓，仅看这个条件，很多人实在不太能理解。项目位于一环边的黄金地段，对面就是省体育馆，依托来福士广场，楼下便是地铁1号线站点，无缝对接，这个地段所带来的商业价值还是比较可观的。2公里外的首座好像已经是目前市场上算得上租金比较贵的项目了，因此，对这个项目在市场上未来所能发挥的作用，还是比较期待。','badb329adf578d63206b4bb3c024917b'),(675,'http://cd.fang.lianjia.com//loupan/p_zjyzaayeb/','30-50W首付投资','使用链家40天',100,'2017-02-16 13:47:43','还有房么?','90458513a486521e3e22e7e97e3c6cc5'),(676,'http://cd.fang.lianjia.com//loupan/p_zjyzaayeb/','187****1385','使用链家44天',60,'2017-02-15 12:00:26','已经卖完了吗？','533db22a7f885edc6b89bcfd86943b13'),(677,'http://cd.fang.lianjia.com//loupan/p_zjyzaayeb/','180****9244','使用链家275天',70,'2017-01-28 23:24:50','有套二的吗','b4af0b879df904069114d7a5da878ca7'),(678,'http://cd.fang.lianjia.com//loupan/p_zjyzaayeb/','jeyee','使用链家129天',80,'2017-01-08 12:00:00','一般','738b742e8fd310b14001561964542aee'),(679,'http://cd.fang.lianjia.com//loupan/p_ssdhcaaygk/','链家房友','使用链家435天',60,'2017-01-09 23:05:18','还有房嘛？？','a5fdc3671b02380c38c020e8647fe40f'),(680,'http://cd.fang.lianjia.com//loupan/p_rscbxslaaynf/','159****1907','使用链家11天',30,'2017-02-09 21:26:36','还有房子吗','5870280f38ac23dc547204f3b8209589'),(681,'http://cd.fang.lianjia.com//loupan/p_rscbxslaaynf/','链家房友','使用链家32天',60,'2017-02-02 20:40:11','北门车站对面，交通方便但是流动人员太多，loft4.9米的层高太压抑了点，5.3是底线，胜在价格可以考虑一下','31b147792199dea8e21472634a7f4c9d'),(682,'http://cd.fang.lianjia.com//loupan/p_wghnyaayoh/','yy','使用链家222天',70,'2017-02-17 15:28:40','为什么13年开盘的房子，现在还有没有卖完的呢，','e105bf5c29da8bdea471b3a05f38b6ed'),(683,'http://cd.fang.lianjia.com//loupan/p_wghnyaayoh/','链家房友','使用链家148天',100,'2017-02-17 12:44:08','请问小公寓的面积是多少','5fc14bfac8ea3933d9e6be87ffe04842'),(684,'http://cd.fang.lianjia.com//loupan/p_wghnyaayoh/','180****2577','使用链家6天',60,'2017-02-14 16:56:19','想问问这楼盘还有小户型吗？小户型房价多少？是70年产权吗？','2767a420be07569c7474ee87e9688788'),(685,'http://cd.fang.