aawjq/','陈翔','使用链家559天',70,'2017-01-17 10:12:25','铂悦山位于地铁二号线书房站，1月7日开盘，在售2.3号楼，每栋2个单元，共有房源800套左右，开盘当日卖出400多套，建面72-114㎡，单价5500-6200元/㎡，主打刚需购房者。\n项目共由5栋住宅和1栋办公楼组成，由于项目占地较小，综合容积率达到4.99，相较于周边项目，居住舒适度不是太高，但是价格也是相对较低的。虽然单价500-1000元的差价在主城区内并不是那么明显，但是对于主打刚需的龙泉来说，价格优势却成了楼盘最大的优势！\n铂悦山正对永辉超市，周边生活配套齐全，交通便捷，依托本地的教育资源，其余并没有什么突出的优势。但是项目一直强调开发商隆基泰和是香港上市房企，楼盘不会出现烂尾，像是有点“此地无银三百两”的感觉，小编实地走访周边发现，这是可能是周边有几处烂尾楼的原因，但是来自河北的隆基泰和这个究竟怎样，还是需要时间来检验。','98c6cb2e84984c2c934b0dada19f7b55'),(2136,'http://cd.fang.lianjia.com//loupan/p_ljthbysaawjq/','小李','使用链家43天',60,'2017-01-09 13:59:36','还行把！方好像在乡下一样！不过六千就哪样！老人家住哪好！年轻人就不要去了！太安静了','5132d3843e80adeaaaf3ffca2c065b8b'),(2137,'http://cd.fang.lianjia.com//loupan/p_ljthbysaawjq/','136****4392','使用链家107天',80,'2017-01-07 16:43:15','今天去认购了，觉得位置还行，离地铁10分钟内，周围商超都有，价格是周边几个楼盘最便宜的几个！','1eb8d6e8f0a8fdd83742f169b58b4a09'),(2138,'http://cd.fang.lianjia.com//loupan/p_zlyxaawri/','136****5332','使用链家69天',80,'2017-02-13 17:32:55','套二还有没有了','567452941a0f927a9ca566a9125935e3'),(2139,'http://cd.fang.lianjia.com//loupan/p_zlyxaawri/','链家房友','使用链家571天',80,'2017-02-12 16:43:30','已经买了，买的套二户型的，今天听说已经卖完了，速度真的太快了。我买的那天还遇到一个小伙子和我抢同一层的。好在我先来，逼得没法，下手了。来吧，加我微信2441640584，我们组个业主群。','69ce71074eb34235d7a141f0edc73458'),(2140,'http://cd.fang.lianjia.com//loupan/p_zlyxaawri/','183****2145','使用链家571天',70,'2017-02-09 19:38:24','今天去看了下，个人觉得户型还可以。有意向的我们组个微信群去团购吧','022b6e4b5cf702eca6cf9abb094ebc0d'),(2141,'http://cd.fang.lianjia.com//loupan/p_undefinedaawum/','陈伟h','使用链家13天',70,'2017-02-08 23:16:17','不知道还有房没','9e926eec67240d17a0ddc86f1930e7d3'),(2142,'http://cd.fang.lianjia.com//loupan/p_undefinedaawum/','链家房友','使用链家571天',60,'2016-10-14 15:27:26','虽然这个楼盘在商业上有些缺乏，但不得不说，他的生态配套太爽了，上次跟过那，旁边就是新都绿化道，绿化面积之高，环境又好，而且还靠河。','a824a5826104f3e15419b58247896aec'),(2143,'http://cd.fang.lianjia.com//loupan/p_xybyaawup/','链家房友','使用链家571天',60,'2016-10-14 15:24:21','从沙盘图看来好像楼间距不是特别大，不晓得会不会影响采光，不过容积率在住宅中还算底的还是不错。另外好像这边只在住宅下会有些门面，是没有独立商业的！！！','538c48c79761b5641de28482ca940451'),(2144,'http://cd.fang.lianjia.com//lou