境可以，周边都是别墅群，空气也不错，小区绿化率很高，小区绿化打造的很好。小区是现代洋房风格，板式大户型，一梯两户，带入户花园。觉得楼盘品质还是可以的','f8c7681ac9815d08e95a0eb6147f5f3a'),(2802,'http://cd.fang.lianjia.com//loupan/p_jmhyhaaego/','付家惠','使用链家519天',80,'2017-01-19 10:53:47','这个盘不好的地方就是别墅位置比较偏，没有大型的生活配套，离温江新城都还有点远。如果喜欢清静的话，这里好的地方就是环境清幽，临近金马湖，小区里面园林景观打造的比较好，水系景观也打造的不错。每个户型都带了花园，前三后四的设计也很适合居住。','551b71ad20142b4af88748285693a6e6'),(2803,'http://cd.fang.lianjia.com//loupan/p_jmhyhaaego/','链家房友','使用链家519天',70,'2017-01-19 10:52:12','金马湖壹号就在金马体育城附近，作为温江的别墅，相较周围的中铁月映长滩和金色湖岸来讲，价格是差不多的。但是品质应该算是里面的中上乘。是现房，可以看到别墅里的实景，目前有243-500多平的联排、独栋、双拼在卖。价格也是100多万到500多万不等，绿化率50%，如果喜欢清静，这里还是不错的。','504eea90035ca7ff6649bbdcd8cc1935'),(2804,'http://cd.fang.lianjia.com//loupan/p_jydlzaavbo/','189****6236','使用链家17天',100,'2017-02-04 20:55:22','环境优美，户型优秀，真正的明蹰明卫。','61bf5b72300c3ed0c60558d9b8e624c5'),(2805,'http://cd.fang.lianjia.com//loupan/p_zlxylaayfo/','链家房友','使用链家2天',50,'2017-02-19 22:13:43','这个三室还有房么？','980be0ded2b348995fd241b440d82570'),(2806,'http://cd.fang.lianjia.com//loupan/p_zlxylaayfo/','链家房友','使用链家70天',40,'2017-01-09 11:07:25','又贵又远配套有差，哪来的自信卖那么贵？','1b299143cfa3046031d40af874d5820d'),(2807,'http://cd.fang.lianjia.com//loupan/p_blxzcaaykt/','链家房友','使用链家519天',70,'2017-01-19 11:21:12','保利西子城开盘的时候就有所听闻，毕竟开发商名气大，楼盘在芙蓉大道旁，周围早就有大宅门紫薇园和芙蓉古城这些中式别墅。保利的别墅看着还是很亮眼，毕竟楼盘容积率只有1.6，环境方面有保利自己打造的保利西子公园，公园比较大，休闲健身配套都有，很适合老人和小孩。','79e4434d8b840c7994d6bd619dc2495b'),(2808,'http://cd.fang.lianjia.com//loupan/p_blszhaayng/','链家房友','使用链家89天',60,'2017-02-03 10:32:08','项目环境真的非常不错，有人工湖，还有环湖绿道，平时休闲娱乐非常方便，周围还有湿地公园、熊猫体育公园，环境方面唯一不足的地方就是项目周围有一些高压电线，不过离得比较远，影响应该比较小；公共交通方面，由于目前周边还不通地铁，公交线路也较少，出行不是很方便，有多的预算可能要考虑买辆车了；购物的话，周边现在还不比较荒，没有什么大型商业配套，购物需要到较远的地方。','349b4c7fb1df7b246918813b8e9721d5'),(2809,'http://cd.fang.lianjia.com//loupan/p_jzyljggaalrm/','链家房友','使用链家559天',60,'2016-09-07 14:59:23','开始以为是光华大道和温泉大道交汇处的那个丽晶巷，结果去项目上看了才发现不是这个，具体位置在花都大道和同兴东路之间，到光华大道有1公里的路程。','81b35d0a59d26e39a3cc2fc1025da0ac'),(2810,'http://cd.fang.lianjia.com//loupan/p_jzyljggaalrm/','链家房友','使用链家559天',70,'2016-08-25