24:03','高档大气','7ef8ddd8be0792068b5bba2a1a981823'),(2996,'http://cd.fang.lianjia.com//loupan/p_lgyjsjaayld/','链家房友','使用链家177天',80,'2017-01-17 12:00:32','户型无敌，物管一般价格太高。精装七千据说，算下来还行，总价最少都两百六七，不知道多少人买得起。','680924ddb1f09ca05864bfcbd4d3f79f'),(2997,'http://cd.fang.lianjia.com//loupan/p_lgyjsjaayld/','链家房友','使用链家395天',90,'2017-01-04 20:04:24','哪套装修可以！','0286758482da68416c9e0a9f90ed9252'),(2998,'http://cd.fang.lianjia.com//loupan/p_lgyjsjaayld/','链家房友','使用链家143天',90,'2016-12-27 14:29:40','项目是蓝光打造的豪宅雍璟系列之一，感觉真的还不错，位于老成都富人区双楠，就在二环边，对于很多老成都人来讲，这个位置还是蛮有情怀可言的。开盘那天去看了下，还请了凯文凯利来，逼格是有的，据售楼部介绍，项目的物业是蓝光嘉宝物业最高级的“金管家”服务，之前对嘉宝物业有所了解，他们的服务口碑还是很不错的。其次项目是双楠少有的精装项目，5000元/平米的精装价格哟，个人还是很喜欢，建议可以去瞧一瞧~','80bff0f581c0c118da4b86992fa2adb4'),(2999,'http://cd.fang.lianjia.com//loupan/p_bsamsaaksf/','186****9609','使用链家163天',80,'2016-09-12 03:09:14','环境也就那样吧 售楼小姐根本不理你 一服你爱买买不买滚蛋的态度 也不介绍','0b5c7fa7c47e2dc354ba19fc4c3a5b85'),(3000,'http://cd.fang.lianjia.com//loupan/p_bsamsaaksf/','链家房友','使用链家559天',100,'2016-08-26 17:53:57','这种别墅真的壕，私人花园都直接占了一层楼了，而且书房跟花园在一起，平时办公累了还可以欣赏一下外面的风景，有益身心健康。三层的别墅还自带电梯，确实很棒。','ca1afb6b504be89ca623eb843d356413'),(3001,'http://cd.fang.lianjia.com//loupan/p_rsglsaaegz/','链家房友','使用链家559天',40,'2016-09-01 17:10:49','大多数别墅都是这样，环境好，不过配套不好，不过要看你自己怎么想了？鱼和熊掌不可兼得','c89b0e3e6e057216430030c24543ea35'),(3002,'http://cd.fang.lianjia.com//loupan/p_lgyjyaaxdi/','186****1885','使用链家132天',60,'2017-02-18 02:15:56','差一点就买了这个楼盘的房子，但最后还是去观玺台买了。雍景园的不足之处1:住高层的帮住别墅的摊7块一平的物管费2:边上的百仁公园还是八字没一撇3:高层对中庭就看人家楼顶4:地理位置确实太偏进出购物都不方便。','7a8a33525250a59cf02aff45acdb1dcd'),(3003,'http://cd.fang.lianjia.com//loupan/p_lgyjyaaxdi/','链家房友','使用链家519天',90,'2017-01-19 11:10:42','生态环境不错，挨着百仁公园，这也是项目的一大卖点。最喜欢的就是户型的设计了，每个户型都带私家花园，户型的采光非常棒，别墅里还配了私人专用电梯，当然价格也很感人，800万-3600万左右，如果去看了别墅的样板间，我觉得你们也会像我一样来点赞的。','a987fe46510d8839b44f97a9fb924a2e'),(3004,'http://cd.fang.lianjia.com//loupan/p_lgyjyaaxdi/','链家房友','使用链家519天',80,'2017-01-19 11:05:41','别墅的地块比较小，38亩，就在海亮的两块地中间。但是走的是高端路线，在价格和设计上都体现的出来。主打改善型大户型。项目只有3栋高层，其他的都是双拼、联排、合院别墅。别墅只有53套。个人觉得物管费偏高，高层7块，别墅10块。','05dfbca65c2ff8e05f28f3d87330b3ad'),(3005,'http://cd.fang.lianjia.com//loupan/p_wkwlslsbsaayip/','链家房友','使用链家419天',100,'2017-01-17 21:35:55','看来，楼盘环境无可挑剔，成实外小学、金苹果幼儿园、中学全部都有，赠送面积很大，产品也很不错','b2be5031d62f06948ff658333e9593c0'),(3006,'http://cd.fang.lianjia.com//loupan/p_blgylaayln/','链家房友','使用链家19天',100,'2017-02-13 12:49:39','下面的门面卖多少钱','52cbcea120cff14b17ffe17551d51964'),(3007,'http://cd.fang.lianjia.com//loupan/p_mmsmshwlkdyaaynp/','链家房友','使用链家143天',90,'2017-01-18 15:54:38','这个蔚蓝卡地亚是双流区的，由牧马山蔚蓝卡地亚俱乐部式邸宅和牧山湖蔚蓝卡地亚组团组成，其中“牧马山”属于“现代欧式”风格，“牧山湖”属于“意式”风格，两者在建筑风格上截然不同。项目园林景观是一大亮点也是卖点，选用的应季植被让园林一年四季都能展现不同的美。2公里范围内的瑞升橄榄山别墅项目，不论从占地，绿化还是产品本身，与之都没有多大的可比性，但也是为不同口味的别墅需求群体打造的，值得一探究竟。','3e443d86c5a1f5673793e62d07257978'),(3008,'http://cd.fang.lianjia.com//loupan/p_ghfhyaalxh/','链家房友','使用链家559天',60,'2016-09-01 15:41:38','价格相对比较便宜，但是环境和配套一般，如果在那附近上班的刚需青年我觉得还是不错的','771c06dbaed6fae8198b5b0d89d89b19'),(3009,'http://cd.fang.lianjia.com//loupan/p_zdwrdaarxg/','奈何挽笑','使用链家4天',100,'2017-02-17 10:50:24','城南二手房新房基本都看完了，还是感觉这个楼盘比较好，距离公园进，离医院也不是很远，特别是精装做工比较好，','13386ea4dce19ff9e6cff285558dc15b'),(3010,'http://cd.fang.lianjia.com//loupan/p_zdwrdaarxg/','151****6320','使用链家213天',100,'2016-10-07 13:51:05','位置就在锦城湖边，都是大户型精装修，楼层也不是很高，20多层。总的来说很不错。','1e0406aff82ac9057266840d5e6792a2'),(3011,'http://cd.fang.lianjia.com//loupan/p_zdwrdaarxg/','链家房友','使用链家571天',100,'2016-09-21 10:07:25','中大文儒德正对锦城湖建设的，自身的绿化环境也很不错，生态环境还是很好的。这个楼盘内周边3公里范围的商业配套非常完善：环球中心、奥克斯广场、伊藤洋华堂、九方购物中心等。以后的生活不用愁，不过卖的都是大户型，针对的是高端购房人群，对经济实力有一定的要求。','f108cf9d2678198055bfef3159f668a2'),(3012,'http://cd.fang.lianjia.com//loupan/p_zdwrdaarxg/','链家房友','使用链家571天',100,'2016-08-30 16:12:57','一个充满文艺范儿的名字，一个得天独厚的位置。城南城市核心地段，楼下就是锦城湖。','ebab4afd6da6be2c7254514442ca5a66'),(3013,'http://cd.fang.lianjia.com//loupan/p_lgyjyaaxdh/','136****7167','使用链家317天',100,'2017-02-12 12:18:46','现在价格多少啊','ff538aebfdce7fa2d7843d9faf7f2cad'),(3014,'http://cd.fang.lianjia.com//loupan/p_lgyjyaaxdh/','链家房友','使用链家339天',100,'2017-01-12 09:22:01','楼盘感觉高端大气上档次，周