.com/loupan/p_aamsi/','链家房友','使用链家350天',100,'2017-02-15 09:37:42','还有房吗，多少一平','7d7f33dbcb8e6035e63825ca6849bb4f'),(9789,'http://cd.fang.lianjia.com/loupan/p_aamsi/','链家房友','使用链家89天',60,'2017-01-18 11:37:32','那天路过售楼部进去问了一下，目前一二三期都只有剩余十几套房源在售了，而且都是现房，主要在售的户型是65㎡套三，均价5600左右。这个项目周边的学校有思源小学和博雅顿幼儿园，至于这两所学校的师资力量如何就不是很清楚了。不过在我看来最大的配套亮点是，三期的商业体自带地下商城和美食街，目前招商也只招餐饮，业主的吃住应该是非常方便。','8fa87ce65b26a13e2588299ffe43d8d5'),(9790,'http://cd.fang.lianjia.com/loupan/p_aamsi/','链家房友','使用链家571天',80,'2016-08-17 18:27:45','想要的都没有了','2b580b80496ebeff7999df48e6d3fa37'),(9791,'http://cd.fang.lianjia.com/loupan/p_aamsi/','152****4911','使用链家226天',100,'2016-08-12 19:30:35','好楼盘，值得投资','585486a0d46b80d1b2e812d484f12806'),(9792,'http://cd.fang.lianjia.com/loupan/p_aamsi/','链家房友','使用链家567天',100,'2016-08-12 18:13:33','小区环境很好！','8bdb00bc0d6eaa95dc0f908be3753d8a'),(9793,'http://cd.fang.lianjia.com/loupan/p_jdtfcaaasn/','秀秀','使用链家169天',100,'2017-02-18 14:18:17','你好，现在均价多少','3416a5dedb9ac1e11dc2f6c57461d5ef'),(9794,'http://cd.fang.lianjia.com/loupan/p_jdtfcaaasn/','人淡如菊','使用链家6天',70,'2017-02-15 11:35:21','请问这里限购吗？','db37469bfb61111a90ecdceedba9f5f4'),(9795,'http://cd.fang.lianjia.com/loupan/p_jdtfcaaasn/','链家房友','使用链家571天',80,'2017-01-20 10:56:34','最近天府城门口在修地铁1号线三期工程，以后通车了那真是方便。除了1号线，以后6号线也要过来，都不到1公里的距离。除了地铁，还有天府大道和红星路可以走，还是方便。楼盘在极地海洋世界对面，周边的环境还是挺好的。找买过这个楼盘的朋友问了下，除了位置不错，听说这个开发商开发的质量和物业都还比较好。现在配套的话，还是不太完善，只能靠小区底商支撑，要不就只能走远点了。看好以后吧。','e7c52e8290ed8e2f58ca0ffe80b71d76'),(9796,'http://cd.fang.lianjia.com/loupan/p_jdtfcaaasn/','夜未央','使用链家61天',100,'2016-12-22 16:22:16','现在还有在售的吗','fab281e1f9788de4dcb2e1f456cb82c3'),(9797,'http://cd.fang.lianjia.com/loupan/p_jdtfcaaasn/','182****2010','使用链家136天',80,'2016-10-10 23:16:22','开盘就不是这个价格了','3e90e6f1979aef5db1724f7b13a35ffe'),(9798,'http://cd.fang.lianjia.com/loupan/p_jdtfcaaasn/','139****7440','使用链家164天',60,'2016-10-03 05:04:47','商业好久开修？','1007c7644578e1ae82f7a55314f1dfd0'),(9799,'http://cd.fang.lianjia.com/loupan/p_jdtfcaaasn/','还可以','使用链家196天',90,'2016-08-26 17:05:13