79平套二户型，均价在6000元/平左右。配套方面，由于是全封闭式社区，社区底商非常少，买东西只有到附近的商超，最近的家乐福驱车大概7、8分钟，项目规划有30万㎡的商业体，但是目前还没动工，估计还要几年呈现，另外小区街对面就是三原外国语学校，以后娃娃读书还是不错。','412716b6f39930445335af34e8f95721'),(10197,'http://cd.fang.lianjia.com/loupan/p_aaese/','心米','使用链家168天',20,'2016-09-07 22:22:40','停车费可以成立一个业主委员会啊！然后业主委员会和开发商打官司啊','fd7df973bc73f474ac100c88366b00cc'),(10198,'http://cd.fang.lianjia.com/loupan/p_aaese/','心米','使用链家168天',20,'2016-09-07 22:22:35','停车费可以成立一个业主委员会啊！然后业主委员会和开发商打官司啊','6303c25dd58bb1ecb39463ecf673893f'),(10199,'http://cd.fang.lianjia.com/loupan/p_aaese/','jialeguojiyezhu','使用链家288天',20,'2016-05-09 11:57:17','1：自2016年元旦入住佳乐国际城二期，出现的问题连续不断。 其一：电梯故障频繁出现，导致邻居关在电梯里面达1个多小时,安全得不到保证。 其二：门禁系统出现故障，几个月未修理甚至更长时间，导致了小区很多户邻居被盗，其财产跟人生为能 够得到安全保证。 其三：2016年5月8日停车费涨价未能任何业主通话，直接执行停车费涨价，导致了邻居们情绪上的波动，其谈判结果，是他们说了算，跟任何部门都没关系，想涨就涨，有视频为证。 其四：服务态度极差，反应一个问题，甚至几周都得不到答复，物业费是最贵的，在佳乐周边地区，停车费都不到50-150元，而佳乐却涨到了400-600。所有业主无法接受。真实写照，开发商说的是你想住就住，涨价继续...........','76b30871a3e51fc4be51c81c326adf5f'),(10200,'http://cd.fang.lianjia.com/loupan/p_xhjycaavie/','链家房友','使用链家571天',80,'2017-01-19 18:14:59','悦城是现房，在天府大道边边上还是比较少见，比较安心。楼盘位置是在极地海洋世界边上，临近天府大道南延线和红星路南延线，有点点距离，自驾方便。周边配套像家乐福这些，也慢慢的完善了，吃的玩的都还是有。个人感觉还是比较适合改善的人买在这儿，毕竟环境还是多巴适的。在售的户型都比较大，148平米以上，价格在15000。这里也算是买未来，等这片居住区整体呈现后前景比较看好。','06d89dc1f3a205e8feb25cdba575ae90'),(10201,'http://cd.fang.lianjia.com/loupan/p_smyhaaibk/','链家房友','使用链家219天',80,'2017-02-12 01:58:18','环境很好','62dd1358b0993650e33a9cc6a32bc29b'),(10202,'http://cd.fang.lianjia.com/loupan/p_ypyjaaupx/','嘿，羽大人','使用链家48天',40,'2017-02-03 21:35:58','老城区了，附近全部低矮的旧房子，出门到地铁这边环境太差了…小路灰尘太大','2f017c792b71111e1a5e049ac6759cf3'),(10203,'http://cd.fang.lianjia.com/loupan/p_ctrcaaeve/','链家房友','使用链家15天',60,'2017-02-05 21:11:06','在成都什么地方首付最低是多少可以告诉我吗多少万可以得话聊聊','34f4e229bd734b93931a37ff1159510b'),(10204,'http://cd.fang.lianjia.com/loupan/p_dyhlsaawsv/','haige','使用链家1天',60,'2017-02-20 15:29:05','请问现在还有房吗？还有新盘吗?','0c7e5c6d18a47d4536f24147bc798ac8'),(10205,'http://cd.fang.lianjia.com/loupan/p_dyhlsaawsv/','链家房友','使用链家11天',80,'2017