也是相对较低的。虽然单价500-1000元的差价在主城区内并不是那么明显，但是对于主打刚需的龙泉来说，价格优势却成了楼盘最大的优势！\n铂悦山正对永辉超市，周边生活配套齐全，交通便捷，依托本地的教育资源，其余并没有什么突出的优势。但是项目一直强调开发商隆基泰和是香港上市房企，楼盘不会出现烂尾，像是有点“此地无银三百两”的感觉，小编实地走访周边发现，这是可能是周边有几处烂尾楼的原因，但是来自河北的隆基泰和这个究竟怎样，还是需要时间来检验。','7197963841adfddad357aad689b84c0a'),(10305,'http://cd.fang.lianjia.com/loupan/p_ljthbysaawjq/','小李','使用链家43天',60,'2017-01-09 13:59:36','还行把！方好像在乡下一样！不过六千就哪样！老人家住哪好！年轻人就不要去了！太安静了','5c7fede01a54a8c5a5f6692bc0dde8d5'),(10306,'http://cd.fang.lianjia.com/loupan/p_ljthbysaawjq/','136****4392','使用链家107天',80,'2017-01-07 16:43:15','今天去认购了，觉得位置还行，离地铁10分钟内，周围商超都有，价格是周边几个楼盘最便宜的几个！','2e99a10102f5afc9cc35930852285fa5'),(10307,'http://cd.fang.lianjia.com/loupan/p_zlyxaawri/','136****5332','使用链家70天',80,'2017-02-13 17:32:55','套二还有没有了','9df2d731801da87946e59b7f42caa23a'),(10308,'http://cd.fang.lianjia.com/loupan/p_zlyxaawri/','链家房友','使用链家571天',80,'2017-02-12 16:43:30','已经买了，买的套二户型的，今天听说已经卖完了，速度真的太快了。我买的那天还遇到一个小伙子和我抢同一层的。好在我先来，逼得没法，下手了。来吧，加我微信2441640584，我们组个业主群。','32269fa0b7d87b0af1af417c61c5e49c'),(10309,'http://cd.fang.lianjia.com/loupan/p_zlyxaawri/','183****2145','使用链家571天',70,'2017-02-09 19:38:24','今天去看了下，个人觉得户型还可以。有意向的我们组个微信群去团购吧','afead81a6d434bddebd47390a521e43e'),(10310,'http://cd.fang.lianjia.com/loupan/p_undefinedaawum/','陈伟h','使用链家13天',70,'2017-02-08 23:16:17','不知道还有房没','af35391c4c1c2527d8fb515d5bf11524'),(10311,'http://cd.fang.lianjia.com/loupan/p_undefinedaawum/','链家房友','使用链家571天',60,'2016-10-14 15:27:26','虽然这个楼盘在商业上有些缺乏，但不得不说，他的生态配套太爽了，上次跟过那，旁边就是新都绿化道，绿化面积之高，环境又好，而且还靠河。','fa7fb612582b20f3a678e0437fe352cb'),(10312,'http://cd.fang.lianjia.com/loupan/p_xybyaawup/','链家房友','使用链家571天',60,'2016-10-14 15:24:21','从沙盘图看来好像楼间距不是特别大，不晓得会不会影响采光，不过容积率在住宅中还算底的还是不错。另外好像这边只在住宅下会有些门面，是没有独立商业的！！！','dbd0208a59166d4676924cbcca2649e2'),(10313,'http://cd.fang.lianjia.com/loupan/p_hrshgcaawwe/','链家房友','使用链家89天',70,'2017-01-17 14:41:07','项目一期已经交房入住，现在卖的是二期，6800元/平的均价在周边来说算是正常价格，目前只有5,8号楼在售，剩余几十套，所以好点的户型和楼层不多，今年3、4月份还会有6号楼开盘，如果要选好的户型和楼层就只有等到明年了。\n商业配套方面，由于项目一期已经交房入住，社区底商已经全部开始营