p_yjlfcsjaascy/','链家房友','使用链家343天',100,'2016-08-12 10:56:00','环境和户型都是很好的哈，超喜欢！周围配套还有待完善。唯一遗憾的是户型偏大，要是有160一180的话立马就买了。','ad433c169e67ea2ab3f8043702c2a5dd'),(11447,'http://cd.fang.lianjia.com/loupan/p_yjlfcsjaascy/','链家房友','使用链家430天',70,'2016-07-14 15:05:12','轻奢精装房，园林绿化很美，空气好，安静适宜养老，孩子入托上学都能在社区内解决，开发商良心之作。不足的是目前市政配套较少：周边无大型的超市、医院、餐馆，生活还是不太方便。公交线路少，就近无地铁站，虽说有小区巴士送至地铁站口，但不知会不会永久提供，有自驾车的影响会小些','06a7037ac9222adf3a2e9a6f1c688306'),(11448,'http://cd.fang.lianjia.com/loupan/p_yjlfcsjaascy/','链家房友','使用链家556天',80,'2016-07-06 10:37:42','老婆比较喜欢别墅，我更倾向这种大平层，挺好的，视野牛','10096769155f40b280710e503011ffee'),(11449,'http://cd.fang.lianjia.com/loupan/p_yjlfcsjaascy/','链家房友','使用链家556天',80,'2016-07-06 10:35:36','小区整体不错，就是样板间装修部风格自己不是特别喜欢，不过性价比可以就是了','8467f24c87c733b5a93b7e315d8ea40a'),(11450,'http://cd.fang.lianjia.com/loupan/p_yjlfcsjaascy/','链家房友','使用链家556天',80,'2016-07-06 10:34:28','看了复地金融岛过来的，价格确实便宜，性价比高','ba945883ed7db09421f8ef55e1fb0cf2'),(11451,'http://cd.fang.lianjia.com/loupan/p_yjlfcsjaascy/','链家房友','使用链家556天',80,'2016-07-06 10:12:41','之前链家的人带我去看了一下，最开始觉得位置挺远的，但是他给我讲了下后期成都的规划，包括跟规划局的朋友也了解了一下，房子确实好，环境不错。','8070b0f27f4ad346850b3fb8cac5dbe5'),(11452,'http://cd.fang.lianjia.com/loupan/p_yjlfcsjaascy/','飞哥','使用链家289天',80,'2016-06-10 20:55:36','麓山稀缺资源，层高3.6米大平层，精装现房，除了现在交通有点不便外，绿化精致，环境优美。','2be0d9841ae965e0e44731f4c175ce8b'),(11453,'http://cd.fang.lianjia.com/loupan/p_lyxzaaswk/','189****6411','使用链家81天',70,'2017-01-18 12:40:10','还有卖吗？','cf7cda1159621e695f86b602a29c4f60'),(11454,'http://cd.fang.lianjia.com/loupan/p_lyxzaaswk/','……','使用链家197天',80,'2017-01-03 12:29:04','是套几的房？','c51ee1e95b30f9a5fdfc3dd7c8406e49'),(11455,'http://cd.fang.lianjia.com/loupan/p_lyxzaaswk/','186****0084','使用链家166天',100,'2016-09-12 22:02:15','交通便利~配套也不错~~还有地暖~~价格也还算便宜~~还是挺不错的~~就是修得有点慢~~','4bbd1ab1e7aec941471d73a45b8298cc'),(11456,'http://cd.fang.lianjia.com/loupan/p_lyxzaaswk/','链家房友','使用链家451天',90,'2016-07-07 11:31:27','交通便利 离地铁多近的 商圈也集中在这边 还可以 就是感觉房子修的有点慢','8690dcc3cdd70af464ad6abcf260f269'),(11457,'http://cd.