光嘉宝物业最高级的“金管家”服务，之前对嘉宝物业有所了解，他们的服务口碑还是很不错的。其次项目是双楠少有的精装项目，5000元/平米的精装价格哟，个人还是很喜欢，建议可以去瞧一瞧~','dd8fcb0d22d18dcfae051e93bd34b913'),(11469,'http://cd.fang.lianjia.com/loupan/p_bsamsaaksf/','186****9609','使用链家163天',80,'2016-09-12 03:09:14','环境也就那样吧 售楼小姐根本不理你 一服你爱买买不买滚蛋的态度 也不介绍','c718f792fe1437bc90e8bd9fee58f483'),(11470,'http://cd.fang.lianjia.com/loupan/p_bsamsaaksf/','链家房友','使用链家559天',100,'2016-08-26 17:53:57','这种别墅真的壕，私人花园都直接占了一层楼了，而且书房跟花园在一起，平时办公累了还可以欣赏一下外面的风景，有益身心健康。三层的别墅还自带电梯，确实很棒。','24b86cf82e3ded2e8c4079ed86cb6e22'),(11471,'http://cd.fang.lianjia.com/loupan/p_rsglsaaegz/','链家房友','使用链家559天',40,'2016-09-01 17:10:49','大多数别墅都是这样，环境好，不过配套不好，不过要看你自己怎么想了？鱼和熊掌不可兼得','60708bddcff1b380779c16db98ab07de'),(11472,'http://cd.fang.lianjia.com/loupan/p_lgyjyaaxdi/','186****1885','使用链家132天',60,'2017-02-18 02:15:56','差一点就买了这个楼盘的房子，但最后还是去观玺台买了。雍景园的不足之处1:住高层的帮住别墅的摊7块一平的物管费2:边上的百仁公园还是八字没一撇3:高层对中庭就看人家楼顶4:地理位置确实太偏进出购物都不方便。','25ebf3feed83494a1b413ba631c5a9cf'),(11473,'http://cd.fang.lianjia.com/loupan/p_lgyjyaaxdi/','链家房友','使用链家519天',90,'2017-01-19 11:10:42','生态环境不错，挨着百仁公园，这也是项目的一大卖点。最喜欢的就是户型的设计了，每个户型都带私家花园，户型的采光非常棒，别墅里还配了私人专用电梯，当然价格也很感人，800万-3600万左右，如果去看了别墅的样板间，我觉得你们也会像我一样来点赞的。','76f784000adcc918a16478e4db8ba0b7'),(11474,'http://cd.fang.lianjia.com/loupan/p_lgyjyaaxdi/','链家房友','使用链家519天',80,'2017-01-19 11:05:41','别墅的地块比较小，38亩，就在海亮的两块地中间。但是走的是高端路线，在价格和设计上都体现的出来。主打改善型大户型。项目只有3栋高层，其他的都是双拼、联排、合院别墅。别墅只有53套。个人觉得物管费偏高，高层7块，别墅10块。','a36e38b09b27d2725abfbcd1ad3675b9'),(11475,'http://cd.fang.lianjia.com/loupan/p_wkwlslsbsaayip/','链家房友','使用链家420天',100,'2017-01-17 21:35:55','看来，楼盘环境无可挑剔，成实外小学、金苹果幼儿园、中学全部都有，赠送面积很大，产品也很不错','ab79dd680c8a7f99aa6a66a52170d67d'),(11476,'http://cd.fang.lianjia.com/loupan/p_blgylaayln/','链家房友','使用链家19天',100,'2017-02-13 12:49:39','下面的门面卖多少钱','146268833c9e3aa39aa153f12a6f5e77'),(11477,'http://cd.fang.lianjia.com/loupan/p_mmsmshwlkdyaaynp/','链家房友','使用链家144天',90,'2017-01-18 15:54:38','这个蔚蓝卡地亚是双流区的，由牧马山蔚蓝卡地亚俱乐部式邸宅和牧山湖蔚蓝卡地亚组团组成，其中“牧马山”属于“现代欧式”风格，“牧山湖”属于“意式”风格，两者在建筑风格上截然不同。项目园林景观是一大亮点也是卖点，选用的应季植被让园林一年四季都能展现不同的美。2公里范围内的瑞升橄榄山别墅项目，不论从占地，绿化还是产品本身，与之都没有多大的可比性，但也是为不同口味的别墅需求群体打造的，值得一探究竟。','4e2905daa0022df8b27bc2093268bb4f'),(11478,'http://cd.fang.lianjia.com/loupan/p_ghfhyaalxh/','链家房友','使用链家559天',60,'2016-09-01 15:41:38','价格相对比较便宜，但是环境和配套一般，如果在那附近上班的刚需青年我觉得还是不错的','39017da469293a95fa84dc6bacdd42ed'),(11479,'http://cd.fang.lianjia.com/loupan/p_zdwrdaarxg/','奈何挽笑','使用链家4天',100,'2017-02-17 10:50:24','城南二手房新房基本都看完了，还是感觉这个楼盘比较好，距离公园进，离医院也不是很远，特别是精装做工比较好，','71996d88a52b57355fce60c1550d46b0'),(11480,'http://cd.fang.lianjia.com/loupan/p_zdwrdaarxg/','151****6320','使用链家213天',100,'2016-10-07 13:51:05','位置就在锦城湖边，都是大户型精装修，楼层也不是很高，20多层。总的来说很不错。','c04ad03486aab2b3442635a2358961d0'),(11481,'http://cd.fang.lianjia.com/loupan/p_zdwrdaarxg/','链家房友','使用链家571天',100,'2016-09-21 10:07:25','中大文儒德正对锦城湖建设的，自身的绿化环境也很不错，生态环境还是很好的。这个楼盘内周边3公里范围的商业配套非常完善：环球中心、奥克斯广场、伊藤洋华堂、九方购物中心等。以后的生活不用愁，不过卖的都是大户型，针对的是高端购房人群，对经济实力有一定的要求。','c3640f594955a7f7af700903970d4d00'),(11482,'http://cd.fang.lianjia.com/loupan/p_zdwrdaarxg/','链家房友','使用链家571天',100,'2016-08-30 16:12:57','一个充满文艺范儿的名字，一个得天独厚的位置。城南城市核心地段，楼下就是锦城湖。','658ab2a820dab61ac141661d31731695'),(11483,'http://cd.fang.lianjia.com/loupan/p_lgyjyaaxdh/','136****7167','使用链家317天',100,'2017-02-12 12:18:46','现在价格多少啊','ebc15141d914d86268bc07cf810e285f'),(11484,'http://cd.fang.lianjia.com/loupan/p_lgyjyaaxdh/','链家房友','使用链家339天',100,'2017-01-12 09:22:01','楼盘感觉高端大气上档次，周边配套不错，也有学校，树德实验中学等。还有百仁公园。作为大户型稀缺资源，后续升值空间很大。','26ab6283a89968b83f3fcc095cc6efe5'),(11485,'http://cd.fang.lianjia.com/loupan/p_ytldshjsdaaegi/','链家房友','使用链家571天',80,'2016-08-19 10:30:33','亚特兰蒂斯黄金时代的小别墅180万起，价格还是比较合适的，最巴适的是他们都是分很多个岛，有种东南亚的感觉，很有好感，就是离市中心稍微有点远，开车都得近1个小时。','404b797b54ceec650840c31827cda153'),(11486,'http://cd.fang.lianjia.com/loupan/p_hlxgaataf/','链家房友','使用链家547天',80,'2016-08-24 18:56:27','感觉黄龙溪谷风景区周围的旅游别墅，肯定不会差。有这么好的景区在周围，还怕没地方耍？还是可以考虑。','493d5bfcbac6339e51adfaa2531055ab'),(11487,'http://cd.fang.lianjia.com/loupan/p_hlxgaataf/','链家房友','使用链家571天',80,'2016-08-24 15:52:50','黄龙溪谷位置在黄龙溪古镇旁边，旅游别墅啊！剑南大道南延线也通到这里，还是可以的。考虑中。','cabd0a8cf49a20c8977b8207ca598f80'),(11488,'http://cd.fang.lianjia.com/loupan/p_zgtjxplaaavcv/','链家房友','使用链家571天',90,'2016-09-21 10:21:01','西派的物管用的是开发商自己的，对于高端楼盘来说，3.7—3.8的物管费不是最贵的，还是可以接受，只是物业服务可以就行。','afd66dfe8a58c8105bfb73298264146e'),(11489,'http://cd.fang.lianjia.com/loupan/p_zgtjxplaaavcv/','链家房友','使用链家571天',100,'2016-09-21 10:20:08','有人可能会觉得高端盘周边略显荒凉，个人认为，其实只要项目内部的绿化景观和相应配套做好了，即使周边荒凉也挺好，高端盘需要的就是一个安静的环境，车多人多的地方反而显得太过吵杂。','b6c4337f1ae1dac8f98dda14033cf8b5');
